import "../App.css";
import React from "react";
import "./Logreg.css";

function Login(){
  function checkLogin(){
      fetch('http://localhost:5000/api/user/letolt', {
          method:'POST',
          body: JSON.stringify({username: this.name.nev, password: this.state.password}),
          headers: {
              'Content-Type':'application/json'
          }
      }).then(res => {
          if(res.status ===200) {
              this.props.loggedIn();
          } else if(res.status ===401){
              console.log(res.status);
              alert('wrong username or password');       
          }else{
              const error = new Error(res.error);
              throw error;
          }
      }).catch(err => {
          console.log(err);
          alert(err);
      });
  }
    
    return(
        <form className="page">
          <div className="reglog1">
            <input type="text" id="un" placeholder="felhasználónév..." name="nev"/><br /><br />
            <input type="password" id="pwd" placeholder="jelszó..." name="password"/><br /><br />
            <button onClick={(e) => checkLogin()} >Login</button>
          </div>
        </form>
    );
}
export default Login;
